Если пока не брать формулу, то схема заполнения массива такая:
t = []
for i in range(251):
    row = []
    for j in range(15):
        if i == 0:
            row.append(1000)
        else:
            row.append(t[i-1][j] + j+1)
    t.append(row)

Посмотреть матрицу можно так:
for row in t:
    print(*row)
